import { useState, useEffect } from "react";
import { useSearchParams } from "react-router-dom";

import Footer from "@/components/Footer";
import { Button } from "@/components/ui/button";
import { Card, CardContent, CardFooter } from "@/components/ui/card";
import { Link } from "react-router-dom";
import { equipmentData } from "@/data/equipmentData";
import { Dumbbell, Bike } from "lucide-react";
import { PageContainer } from "@ant-design/pro-components"

const categories = [
  { id: "all", name: "", icon: <Dumbbell className="w-5 h-5" /> },
  { id: "cardio", name: "", icon: <Bike className="w-5 h-5" /> },
  { id: "strength", name: "", icon: <Dumbbell className="w-5 h-5" /> },
  { id: "functional", name: "", icon: <Dumbbell className="w-5 h-5" /> },
  { id: "accessories", name: "", icon: <Bike className="w-5 h-5" /> }
];

const EquipmentList = () => {
  const [searchParams, setSearchParams] = useSearchParams();
  const [activeCategory, setActiveCategory] = useState("all");
  const [filteredEquipment, setFilteredEquipment] = useState(equipmentData);

  useEffect(() => {
    const category = searchParams.get("category") || "all";
    setActiveCategory(category);

    if (category === "all") {
      setFilteredEquipment(equipmentData);
    } else {
      setFilteredEquipment(equipmentData.filter(item => item.category === category));
    }
  }, [searchParams]);

  const handleCategoryChange = (categoryId: string) => {
    setActiveCategory(categoryId);
    if (categoryId === "all") {
      setSearchParams({});
    } else {
      setSearchParams({ category: categoryId });
    }
  };

  return (
    <div style={{ 
      position: 'relative',
      margin: '-24px -24px 0', // antd
      width: 'calc(100% + 48px)'
    }}>
      {/*  */}
      <div className="bg-gym-primary text-white py-16 w-full" 
           style={{
             position: 'relative',
             zIndex: 10,
             boxShadow: '0 4px 6px -1px rgba(0, 0, 0, 0.1)',
             paddingTop: '8rem',   // 
    paddingBottom: '4rem',// 
    marginTop: '2rem'     // 
           }}>
        <div className="container mx-auto px-4 text-center">

          <h1 className="text-3xl md:text-4xl font-bold mb-4"></h1>
          <p className="text-white/80 max-w-2xl mx-auto">

          </p>
        </div>
      </div>

      {/*  */}
      <PageContainer 
        // 
        header={{ 
          title: false,
          breadcrumb: { items: [] }
        }}
        style={{
          backgroundColor: 'transparent',
          padding: 0,
          marginTop: '-24px'
        }}
      >
        <div className="container mx-auto px-4">
          {/* Category Filters */}
          <div className="flex flex-wrap gap-3 mb-10 justify-center">
            {categories.map((category) => (
              <Button
                key={category.id}
                variant={activeCategory === category.id ? "default" : "outline"}
                className={`flex items-center gap-2 ${
                  activeCategory === category.id 
                    ? "bg-gym-primary hover:bg-gym-primary/90" 
                    : "border-gym-gray/30 text-gym-primary"
                }`}
                onClick={() => handleCategoryChange(category.id)}
              >
                {category.icon}
                {category.name}
              </Button>
            ))}
          </div>

          {/* Equipment Grid */}
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-6">
            {filteredEquipment.map((item) => (
              <Card key={item.id} className="overflow-hidden hover-scale">
                <div className="relative h-60 overflow-hidden">
                  <img 
                    src={item.image} 
                    alt={item.name} 
                    className="w-full h-full object-cover"
                  />
                </div>
                <CardContent className="pt-6">
                  <h3 className="text-xl font-bold mb-2">{item.name}</h3>
                  <p className="text-gym-gray line-clamp-2">{item.shortDescription}</p>
                </CardContent>
                <CardFooter>
                  <Button 
                    variant="outline" 
                    className="w-full border-gym-primary text-gym-primary hover:bg-gym-primary hover:text-white"
                    asChild
                  >
                    <Link to={`/equipment/${item.id}`}></Link>
                  </Button>
                </CardFooter>
              </Card>
            ))}
          </div>

          {filteredEquipment.length === 0 && (
            <div className="text-center py-16">
              <Dumbbell className="w-16 h-16 text-gym-gray mx-auto mb-4" />
              <h3 className="text-2xl font-bold mb-2"></h3>
              <p className="text-gym-gray">

              </p>
              <Button 
                className="mt-4 bg-gym-primary hover:bg-gym-primary/90"
                onClick={() => handleCategoryChange("all")}
              >

              </Button>
            </div>
          )}
        </div>
      </PageContainer>

    </div>
  );
};

export default EquipmentList;

