            <>
              <ProFormText
                name="memberAccount"
                fieldProps={{
                  size: 'large',
                  prefix: <UserOutlined />,
                }}
                placeholder=""
                rules={[
                  {
                    required: true,
                    message: '',
                  },
                ]}
              />
              <ProFormText.Password
                name="memberPassword"
                fieldProps={{
                  size: 'large',
                  prefix: <LockOutlined />,
                }}
                placeholder=""
                rules={[
                  {
                    required: true,
                    message: '',
                  },
                  {
                    min: 8,
                    message: '8',
                  },
                ]}
              />
            </>
          )}
          <div className={styles.tips}>
            
            <Link to="/member/register"></Link>
          </div>
        </LoginForm>
      </div>
      <Footer />
    </div>
  );
};

export default Login;

