                  size: 'large',
                  prefix: <UserOutlined />,
                }}
                placeholder=""
                rules={[
                  {
                    required: true,
                    message: '',
                  },
                  {
                    min: 4,
                    message: '4',
                  },
                  {
                    pattern: /^[a-zA-Z0-9_]+$/,
                    message: '',
                  },
                ]}
              />
              <ProFormText.Password
                name="memberPassword"
                fieldProps={{
                  size: 'large',
                  prefix: <LockOutlined />,
                }}
                placeholder=""
                rules={[
                  {
                    required: true,
                    message: '',
                  },
                  {
                    min: 8,
                    type: 'string',
                    message: '8',
                  },
                ]}
              />
              <ProFormText.Password
                name="checkPassword"
                fieldProps={{
                  size: 'large',
                  prefix: <LockOutlined />,
                }}
                placeholder=""
                rules={[
                  {
                    required: true,
                    message: '',
                  },
                  {
                    min: 8,
                    type: 'string',
                    message: '8',
                  },
                ]}
              />
            </>
          )}
          <div className={styles.tips}>

            <Link to="/member/login"></Link>
          </div>
        </LoginForm>
      </div>
      <Footer />
    </div>
  );
};

export default Register;

