import type { ActionType, ProColumns } from '@ant-design/pro-components';
import { ProTable, TableDropdown, ModalForm, ProFormText, ProFormSelect } from '@ant-design/pro-components';
import { useRef, useState } from 'react';
import { Image, message, Tag } from 'antd';
import { listMemberVoByPageUsingPost, updateMemberUsingPost, deleteMemberUsingPost, addMemberUsingPost } from '@/api/memberController';
import request from '@/utils/request';

const columns: ProColumns<API.MemberVO>[] = [
  {
    dataIndex: 'id',
    valueType: 'index',
    width: 48,
    title: '',
    hideInSearch: true,
    editable: false,
    render: (_, __, index) => index + 1,
  },
  {
    title: '',
    dataIndex: 'memberName',
    copyable: true,
    ellipsis: true,
    formItemProps: {
      rules: [
        {
          required: true,
          message: '',
        },
      ],
    },
  },
  {
    title: '',
    dataIndex: 'memberAccount',
    copyable: true,
    ellipsis: true,
    editable: false,
  },
  {
    title: '',
    dataIndex: 'memberAvatar',
    render: (_, record) => (
      <div>
        <Image src={record.memberAvatar || 'https://28082003.com/images/preview.jpg'} width={100} />
      </div>
    ),
  },
  {
    title: '',
    dataIndex: 'gender',
    valueEnum: {
      0: { text: '', status: 'Default' },
      1: { text: '', status: 'Success' },
      2: { text: '', status: 'Error' },
    },
  },
  {
    title: '',
    dataIndex: 'memberRole',
    valueType: 'select',
    valueEnum: {
      member: { text: '', status: 'Default' },
      admin: { text: '', status: 'Success' },
    },
    render: (_, record) => {
      const color = record.memberRole === 'admin' ? 'success' : 'processing';
      return (
        <Tag color={color}>
          {record.memberRole === 'admin' ? '' : ''}
        </Tag>
      );
    },
  },
  {
    title: '',
    dataIndex: 'createTime',
    valueType: 'dateTime',
    sorter: true,
    hideInSearch: true,
    editable: false,
  },
  {
    title: '',
    valueType: 'option',
    render: (text, record, _, action) => [
      <a
        key="editable"
        onClick={() => {
          if (record.id) {
            action?.startEditable?.(record.id);
          }
        }}
      >
        
      </a>,
      <TableDropdown
        key="actionGroup"
